import Container from "@mui/material/Container";
import { Routes, Route } from "react-router-dom";

import React from "react";
import { Header } from "./components";
import { Home, Registration, Login, AddRasp, AddDay,AddTime, AddPredmet } from "./pages";
import { useDispatch, useSelector } from "react-redux";
import { fetchAuthMe, selectIsAuth } from "./redux/slices/auth";
import { AddGroup } from "./pages/AddGroup";
import { AddTeacher } from "./pages/AddTeacher";



function App() {
  const dispatch = useDispatch();
  const isAuth = useSelector(selectIsAuth);

  React.useEffect(() => {
    dispatch(fetchAuthMe());
  }, []);
  return (
    <>
      <Header />
      <Container maxWidth="lg">
        <Routes>
          <Route path="/for-admin" element={<Home />} />
          <Route path="/for-admin/rasps/:id/edit" element={<AddRasp />} />
          <Route path="/for-admin/add-rasp" element={<AddRasp />} />
          <Route path="/for-admin/login" element={<Login />} />
          <Route path="/for-admin/register" element={<Registration />} />
          <Route path="/for-admin/add-time" element={<AddTime/>} />
          <Route path="/for-admin/times/:id/edit" element={<AddTime/>} />
          <Route path="/for-admin/add-predmet" element={<AddPredmet/>} />
          <Route path="/for-admin/predmets/:id/edit" element={<AddPredmet/>} />
          <Route path="/for-admin/add-group" element={<AddGroup/>} />
          <Route path="/for-admin/groups/:id/edit" element={<AddGroup/>} />
          <Route path="/for-admin/add-teacher" element={<AddTeacher/>} />
          <Route path="/for-admin/teachers/:id/edit" element={<AddTeacher/>} />
        </Routes>
      </Container>
    </>
  );
}

export default App;
